import React from 'react';
import { Code } from 'lucide-react';

const ProjectGrid = ({ projects, openProjectModal }) => {
  return (
    <div className="grid grid-cols-3 gap-6 w-full">
      {projects.map((project) => (
        <div
          key={project.id}
          className="aspect-square bg-gray-800 rounded-xl overflow-hidden shadow-lg hover:shadow-2xl transition-all duration-300 cursor-pointer flex items-center justify-center"
          onClick={() => openProjectModal(project)}
        >
          <div className="text-purple-400 hover:text-purple-300 transition-colors duration-300">
            <Code size={48} />
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProjectGrid;
